import React from 'react';
import './App.css';
import { Home, CreateWodRoute } from './routes';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
function App() {
    return (
        <Router>
        <div>
          <Switch>
            <Route path="/">
              <Home></Home>
            </Route>
            <Route path="/create">
            <CreateWodRoute></CreateWodRoute>
          </Route>
            {/* <Route path="/create/wod" exact Component={CreateWodRoute}></Route> */}
          </Switch>

        </div>

        </Router>
    );
}

export default App;
